		//פונקציה לשינוי מיקום הארנב לפי המקשים שנלחצו
		function handlekeypress(e) {
		
			//זוז ימינה
			if (e.keyCode == 39 && stage.getChildByName("myBunny").x < 1000) {
				stage.getChildByName("myBunny").gotoAndPlay(2);
				directionX = 20;
				stage.getChildByName("myBunny").x += directionX;
				stage.getChildByName("myBunny").scaleX = -1;
			}
		
			// זוז שמאלה
			if (e.keyCode == 37 && stage.getChildByName("myBunny").x > 10) {
				stage.getChildByName("myBunny").gotoAndPlay(2);
				directionX = -20;
				stage.getChildByName("myBunny").x += directionX;
				stage.getChildByName("myBunny").scaleX = 1;
			}
		
			//תנאי לבדיקת חפיפה בין הארנב לשלטים
			for (i = 1; i < answers[Qrandom].length; i++) {
				if (intersect(stage.getChildByName("myBunny"), theSighns.getChildByName("window" + i))) {
					theSighns.getChildByName("window" + i).gotoAndStop(2);
		
					if (e.keyCode == 32) {
						Qbubble.gotoAndStop(0);
						showquestion.y = 165;
						if (answers[Qrandom][0][2] == "pic") {
							myPicQ.visible = false;
							ZoomIn.visible = false;
						}
						clearInterval(myTimer);
						answers[Qrandom][0][1]++; // מספר הפעמים שהשאלה מופיע במשחק
						stage.getChildByName("myBunny").scaleX = 1; // העברת הארנב למצב זריקה
						theCarrot = i; // משתנה שנוצר לשמירת מיקום הגזר
						stage.getChildByName("myBunny").x = theSighns.getChildByName("carrot" + i).x - 15;
						clearInterval(myTimer); // עצירת הזמן
						QTime = 60 - timer; // כמה זמן לקח לשחקן לענות על השאלה
						Pause.visible = false;
						carrotTime = 6; //כמות השניות שהגזר מחכה עד שהוא מופעל
						crrotMove(); //קריאה לפונקציה שמפעילה את האנימציה של הגזר
						if (answers[Qrandom][randArr[i - 1]][1] == "true") {
							success(); //קריאה לפונקציית הצלחה
		
						} else {
							fail(); //קריאה לפונקציית אי הצלחה
						}
						window.removeEventListener("keydown", handlekeypress); // עצירת התזוזה של הארנב
		
					}
				} else {
					theSighns.getChildByName("window" + i).gotoAndStop(0);
				}
			}
		}
