				basketCarrot.x = 1245 - (counter * 10); // מיקום חצי הגזר בסלסלה
				basketCarrot.y = 500;
				theSighns.getChildByName("carrot" + theCarrot).visible = false; // הסתרת הגזר הרגיל
				stopticker = 0;
